response_body_spec:
{
  apiSuccess: (.apiSuccess and (.responses.succeeded // false)),
  responses: (if (.apiSuccess and (.responses.succeeded // false)) then 
    {customerid: .responses.result.id} 
  else 
    null 
  end),
  errors: (if (.apiSuccess and (.responses.succeeded // false)) then 
    null 
  else 
    {
      errorNum: .errors.errorNum,
      errorMsg: .errors.errorMsg
    } 
  end)
}
